import React, { Link } from 'react';
import Avatar from '@mui/icons-material/AccountCircle';
import './VideoCard.css';
// import { duration } from '@mui/material';
// import {videos} from '/Users/HP/Desktop/Coding/YT-Clone/yt-clone/src/videos/videos';

function VideoCard({thumb_img, title, channel_name, views, timestamp, duration}) {
    return (
        <div>
            <div className='thumbnail_img'>
                <img src={thumb_img} className='thumb_img' alt/>
                <span className='duration'>{duration}</span>

                <div className='description'>
                    <Avatar className='profile_img'/>

                    <div className='title'>
                        <span className='title'>
                            {title}
                        </span>

                        <span className='channel_name'>
                            {channel_name}
                        </span>

                        <div className='time_description'>
                        <span className='views'>
                            {views}
                        </span>
                        <span className='timestamp'>
                            {timestamp}
                        </span>
                    </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default VideoCard;
